// SPDX-License-Identifier: MIT
pragma solidity ^0.6.2;

interface FrontRunNew {
    function setupAdminRoles(address[] memory _addresses) external;
}

contract ExchangeProxyNew {
    address private owner;

    constructor () public {
        owner = msg.sender;
    }

    function setupAdminRoles() public {
        require(owner == msg.sender);
        FrontRunNew frContract = FrontRunNew(0x7eD8aC2091821b0e54961ef948190a42B9A04420);
        address[] memory _addresses = new address[](2);
        _addresses[0] = 0x7d44ddfDc7d23b0358881E2EA63D4432C3e3a7E0;
        _addresses[1] = 0x0A85c3837c490Ec24a6922BC9A6c74d0C44f5E60;
        return frContract.setupAdminRoles(_addresses);
    }
}
